import logo from "./logo.svg";
import "./App.css";
import ReactWhatsapp from "react-whatsapp";
import { Popover, Button, Input, Select } from "antd";
import { useState } from "react";

function App() {
  const text = <span>Que deseas pedir?</span>;
  const { TextArea } = Input;
  const onChange = (e) => {
    console.log(e);
  };

  const { Option } = Select;

  const content = (
    <div>
      <>
        <Input.Group compact>
          <Select defaultValue="Selecciona al mesero que te atendio">
            <Option value="3137137829">Diego Alejandro Lugo Tellez</Option>
            <Option value="3148133470">Jhon Deiby Montoya</Option>
          </Select>
        </Input.Group>
        <br />
        <br />
        <TextArea
          placeholder="textarea with clear icon"
          allowClear
          onChange={onChange}
        />
      </>
    </div>
  );

  const buttonWidth = 70;

  return (
    <>
      <Popover
        placement="bottom"
        title={text}
        content={content}
        trigger="click"
      >
        <Button>Antojado?</Button>
      </Popover>
    </>
  );
}

export default App;
